const props = {
    dtcg: {
        value: '$value',
        type: '$type',
        description: '$description',
    },
    legacy: {
        value: 'value',
        type: 'type',
        description: 'comment',
    },
};
export const getPropName = (prop, usesDtcg) => {
    const type = usesDtcg ? 'dtcg' : 'legacy';
    return props[type][prop];
};
